import styled from "styled-components";

const SideBar = () => {
  return <SideBarWrapper></SideBarWrapper>;
};

export default SideBar;

const SideBarWrapper = styled()`
  background: rgba(245, 245, 245, 0.5);
  max-width: 250px;
  border-right: 1px solid rgba(180, 180, 180, 1);
  width: 100%;
  height: 100vh;
`;
